                WriteLiteral(@"ss=""tab-pane fade show active"" id=""pills-home"" role=""tabpanel"" aria-labelledby=""pills-home-tab"">
                                    <h3 class=""tab-title"">Ürün Açıklaması</h3>
                                    <p>
                                        Hollandalı ressam Vincent Van Gogh’un Norveç Ulusal Müzesi’nde sergilenen otoportresinin sanatçıya ait olup olmadığı yıllardır üzerinde araştırma yapılan bir konuydu. Yapılan araştırmalar sonucu, eserin Van Gogh’a ait olduğu kantılandı. Self Portrait (1889) uzmanlara göre Van Gogh’un psikoz tedavisi gördüğü yılda yaptığı tek eser olarak tanımlanıyor. Araştırma için Norveç’ten Hollanda’da bulunan Van Gogh müzesine gönderilen eserin yaklaşık beş yıl süren analizler sonucu sahte olmadığı kanısına varıldı.
                                    </p>
                                    <p>
                                        1970’li yıllardan beri gerçekliği tartışma konusu olan eser Hollanda Van Gogh Müzesi’nde yoğun bir araştırma ve analiz sürecinden geç");
                WriteLiteral(@"irildi. Bu süreçte X-Ray aracılığı ile kanvasın taranması, fırça darbelerinin analizi ve Van Gogh’un kardeşi Theo’ya bu dönemde yazdığı mektuplar, eserin Van Gogh tarafından yapıldığına işaret ediyor.  Uzmanlar eserin 1889 yılında Saint-Remy Fransa’da bulunan ruh ve sinir hastalıkları hastanesinde yapıldığının sonucunu çıkarttılar. Eylül 1889 tarihli bir mektupta sanatçı kardeşine eserden psikoz tedavisi gödüğü zamanda yaptığı bir deneme olarak bahsettiği belirtiliyor. Sanatçı aynı zamanda altı hafta süren ağır bir psikotik kriz geçirdiğini ve sonlarına doğru resim yapmaya başlayabilmesine rağmen hala psikolojik olarak rahatsız olduğunu mektuplarında belirtmiş.
                                    </p>
                                    <p>
                                        Otoportrenin gerçekliğinin sorgulanması Van Gogh’un yaptığı diğer 35 otoportreden çok daha farklı olmasından kaylanklanıyor.  Van Gogh Müzesi’ndeki uzman araştırmacı Louis van Tilborgh, otoportrenin Van Gogh'un tekniklerine benzer");
                WriteLiteral(@" olduğunu ama aynı zamanda önceki işleriyle ilgili kopukluklar olduğunu belirterek sanatçı ruh sağlığı bozukken bu eseri yapması sebebi ile rahatsızlığının kanvasa yansıtıldığı sonucuna vardıklarını söylemişti.
                                    </p>
                                    <p>
                                        Van Gogh’un aynı dönemde kullandığı renklerin eserdeki renklere göre daha canlı olması ve eserin bitirilmemiş görüntüsüne ait başlayan sorgulama ve araştırmaların sonucunda Self-Portrait (1889) eserinin Van Gogh’a ait olduğu sonuçlandı. Eser, şu an Van Gogh Müzesi’nde sergileniyor ve 2021 yılında Oslo’ya geri gönderilecek.
                                    </p>
                                </div>
                                <div class=""tab-pane fade"" id=""pills-profile"" role=""tabpanel"" aria-labelledby=""pills-profile-tab"">
                                    <h3 class=""tab-title"">Sanatçının Hayatı</h3>
                                    <p>
                          ");
                WriteLiteral(@"              Vincent Willem van Gogh 30 Mart 1853 - 29 Temmuz 1890), Hollandalı ard izlenimci ressam. Batı dünyası sanat tarihinin en tanınmış ve en etkili şahsiyetlerinden biridir. On yıldan biraz fazla bir süre içinde aralarında 860 yağlı boya tablonun da olduğu 2.100 kadar resim ve çizim çalışması üretti ve bunların çoğu yaşamının son iki yılında yapıldı. Bunların arasında manzaralar, natürmortlar, portreler ve otoportreler bulunmaktadır ve modern sanatın temelleri sayılan cür'etkâr renkler ile canlı, fevrî ve ifade dolu fırça darbeleriyle ayırt edilirler. 37 yaşında yıllardır süren psikolojik rahatsızlığı ve yoksulluğun ardından trajik bir biçimde kimilerine göre intihar, kimilerine göre bir cinayet sebebiyle silahla yaralandıktan birkaç gün sonra hayata veda etti.
                                    </p>
                                    <p>
                                        Üst orta sınıf bir aileye doğan van Gogh çocukken ciddi, sessiz ve saygılıydı ayrıca resim de yapmaktaydı. Gençliğinde ");
                WriteLiteral(@"sanat simsarı olarak çalıştı ancak Londra'ya gönderildikten sonra bunalıma girdi. Döndükten sonra Belçika'nın güneyinde Protestant misyoner olarak çalıştı. Sağlığı bozulup yalnızlık içinde yaşadıktan sonra ebeveynlerinin yanına döndü ve 1881 yılında resim yapmaya başladı. Küçük kardeşi Theo tarafından maddi olarak desteklendi ve ikisi yıllarca mektupla yazıştılar. Çoğunlukla natürmortlar ve çalışan köylülerin tasvirlerinden oluşan ilk çalışmalarında daha sonraki eserlerinin ayırt edici niteliği olan canlı renkler görülmez. 1886 yılında taşındığı Paris'te, izlenimci hassasiyete karşı tepki gösteren ve aralarında Émile Bernard ile Paul Gauguin'in de bulunduğu avangart üyeleriyle tanıştı. Çalışmaları geliştikçe natürmortlara ve yerel manzaralara yeni bir yaklaşım getirdi. Resimlerinde daha parlak renkler kullanmaya başladı ve daha sonra 1888'de Fransa'nın güneyinde kaldığı Arles'da ustalaşacağı kendine özgü bir üslûp geliştirdi. Bu dönemde zeytin ağaçları, selviler, buğday tarlaları ve ayçiçekleri de tuvallerine");
                WriteLiteral(@" konu olmaya başladı.
                                    </p>
                                    <p>
                                        Psikotik epizodlardan ve delüzyonlardan muzdarip olan van Gogh zihin sağlığından endişe duymasına rağmen fiziksel sağlığını ekseriyetle ihmal etmiş düzgün beslenmemiş ve aşırı alkol almıştır. Gauguin ile arkadaşlığı bir ustura ile yolunu kesmesi ve öfke nöbeti sonucu sol kulağının bir kısmını keserek yaralaması sonucu sona ermiştir. Bir dönem Saint-Rémy'de olmak üzere akıl hastanelerinde kalmıştır. Hastaneden kendi isteğiyle ayrıldıktan sonra Paris yakınlarında Auvers-sur-Oise'da Auberge Ravoux'ya taşındı ve homeopati uygulayan doktor Paul Gachet tarafından tedavi edilmeye başladı. Depresyonu devam etti ve 27 Temmuz 1890'da bir altıpatlarla kendini göğsünden vurdu. İki gün sonra yaraları nedeniyle öldü.
                                    </p>
                                    <p>
                                        Yaşadığı sürede başarısız olan van Gogh'a");
                WriteLiteral(@" deli gözüyle bakılıyordu. İntiharından sonra şöhret kazanan ressam halkın imgeleminde tipik yanlış anlaşılmış dahi, ""çılgınlık ve yaratıcılığın bir arada olduğu söylemlerini""[2] gösteren bir ressam olarak yer almıştır. Resim üslûbunun ögeleri fovistler ve Alman dışavurumcuları tarafından kullanılmaya başladıktan sonra 20. yüzyılın başlarında ünü artmaya başlamıştır. Sonraki yıllar boyunca çok yaygın bir eleştirel, ticari ve popüler bir başarı yakalayan van Gogh sorunlu kişiliğinin romantik, azap çeken sanatçı idealini simgelediği önemli ama hüzünlü bir ressam olarak hatırlanmaktadır.
                                    </p>
